import React from "react";
import { useNavigate } from "react-router-dom";
import { Backbtn, GreyBanana, GreyScore, Playbtn } from "../assets/svgs/svgs";
import SuggesstionCard from "../common/SuggesstionCard";

function PlayStart() {
  const navigate = useNavigate();
  return (
    <div className="container d-flex-center h-100p">
      <div className="button back" onClick={() => navigate("/confirm")}>
        {<Backbtn height="146" width="146" />}
      </div>
      <div className="score-level">
        {" "}
        <GreyScore height="37" width="755" />
        <div className="score-level-abs">
          <GreyBanana height="139" width="134" />
        </div>
      </div>
      <div className="cards-container">
          <div className="cards-container--item">
            {
                allcards.map((value: any, index: number) => {
                  if (index <= 5)
                    return <SuggesstionCard color="pink" />;//<PlayCard key={value.id} value={value} handleClick={handleClick} />;
                })
            }
          </div>
          <div className="cards-container--item">
          {
                allcards.map((value: any, index: number) => {
                  if (index > 5)
                    return <SuggesstionCard color="blue" />;//<PlayCard key={value.id} value={value} handleClick={handleClick} />;
                })
            }
            {
              Array(6).fill(0).map((_,ind) => <React.Fragment key={ind}>
                <SuggesstionCard color="blue" />
              </React.Fragment>)
            }
          </div>
        </div>
      <div className="button down" onClick={() => navigate("/game")}>
        {<Playbtn height="90" width="339" />}
      </div>
    </div>
  );
}

export default PlayStart;
